import Foundation
import XCTest
class SolutionTests: XCTestCase {
    var solution: Solution!
    override func setUp() {
        super.setUp()
        solution = Solution()
    }
    
    func testExample1() {

        let trie = Trie()

        trie.insert("apple")
        XCTAssertEqual(trie.search("apple"), true) // returns true
        XCTAssertEqual(trie.search("app"), false)   // returns false
        XCTAssertEqual(trie.search("appleaaa"), false)   // returns false
        XCTAssertEqual(trie.startsWith("app"), true) // returns true
        trie.insert("app");
        XCTAssertEqual(trie.search("app"), true)   // returns true
        print(trie)
    }

    func testExample2() {

        let trie = Trie()

        trie.insert("hello")
        XCTAssertEqual(trie.search("hell"), false) // returns false
        XCTAssertEqual(trie.search("helloa"), false)   // returns false
        XCTAssertEqual(trie.search("hello"), true)   // returns true
        XCTAssertEqual(trie.startsWith("app"), false) // returns false
        XCTAssertEqual(trie.startsWith("hell"), true)   // returns true
        print(trie)
    }

    func testExample3() {
        let trie = Trie()
        trie.insert("app")
        trie.insert("apple")
        trie.insert("beer")
        trie.insert("add")
        trie.insert("jam")
        trie.insert("rental")
        XCTAssertEqual(trie.search("apps"), false) // returns true
        XCTAssertEqual(trie.search("app"), true)   // returns false
        XCTAssertEqual(trie.search("ad"), false)   // returns false
        XCTAssertEqual(trie.search("applepie"), false)   // returns false
        XCTAssertEqual(trie.startsWith("applepie"), false) // returns false
        print(trie)
    }
}

SolutionTests.defaultTestSuite.run()


